/// # Getting Started With the Tradovate API
/// The Tradovate API is a robust web interface that clients can utilize to bring our Trading services to their own applications and  extensions.
/// There are a number of supported operations that a client can perform by accessing the REST API. Essentially any functionality that is available on the
/// Tradovate Trader application is also exposed via the API. For the comprehensive JavaScript guide to using our API, please go [here](https://github.com/tradovate/example-api-js/).
///
/// ## Place and Modify Orders
/// The Tradovate REST API makes it easy to place and modify orders from code. Any type of order supported by the Tradovate Trader application
/// is also able to be placed via the REST API. For interactive examples see the [Orders](#tag/Orders) section.
///
/// ## Query Positions, Contracts, Maturities and More
/// From the Tradovate REST API we can get data about positions, contracts, products, prices, currencies, maturities, and more. Any data that you could view by
/// browsing Tradovate Trader is queryable from the API. For interactive examples see the [ContractLibrary](#tag/ContractLibrary) section.
///
/// ## Query Account Data
/// Using our `/account/*` operations allow you to do things like find an account by its ID, get a snapshot of an account's current cash balance, and access
/// account trading permissions. For interactive examples see the [Accounting](#tag/Accounting) section.
///
/// ## Manage Risk
/// We can use all of the risk management features available on Tradovate Trader from the API. This includes setting position limits and creating, deleting,
/// and modifying risk-parameters. For live examples, see the [Risk](#tag/Risks) section.
///
/// ## Access Alert and Live Chat Functions
/// You can use the REST API to generate alerts which can be seen from the Tradovate Trader application. You can use all of the Chat functionality from from 
/// the REST API. This includes opening and closing the chat context, querying and posting chat message items, and even allowing us to mark a chat item as
/// 'read'. For more examples see the [Alerts](#tag/Alerts) and [Chat](#tag/Chat) sections.
///
/// ## How Do I Use the Tradovate REST API?
/// In order to access the features of the Tradovate REST API you'll need to sign up for a [Tradovate Trader](https://trader.tradovate.com/welcome) account. You must meet some other requirements as well:
/// - You need a LIVE account with more than $1000 in equity.
